import React from "react";
import "./style.css";

function Card(props) {
    return (
<div className="card-body cusCard" onClick={() => props.checkGuess(props.id)} >
      <div className="img-container">
        <img alt={props.name} src={props.image} />
      </div>

</div>

);
}

export default Card;
